import React from "react";
import {
  Button,
  Divider,
  Typography,
  Card,
  Box,
  AvatarTable,
  Table,
  TableBody,
  TableCell,
  TableContainer,
  TableHead,
  TableRow,
  Paper,
  RadioGroup,
  FormControlLabel,
  Radio,
  TextField,
  FormGroup,
  Checkbox,
} from "@mui/material";

const TestCreator = () => {
  return (
    <div>
      <Typography variant="h5" sx={{ fontWeight: 500 }}>
        Kreator Testu
      </Typography>
      <Divider></Divider>
    </div>
  );
};

export default TestCreator;
